import logo from './logo.svg';
import './App.css';
import styled from 'styled-components'
import Navbar from './components/Navbar';
import Casas from './components/Casas.js';
import Departamentos from './components/Departamentos.js';
import Edificios from './components/Edificios.js';
import Townhouse from './components/Townhouse.js';
import Header from './components/Header.js';
import Inmueble from './components/Inmueble.js';

function App() {
  return (
    <>

    <Header/>
    <Inmueble
      titulo="Departamento en Las Condes"
      subtitulo="Proyecto Plaza el Golf: 4 dormitorios, y 2 baños."
      imagenInmueble= "https://peverdemarketing.com/wp-content/uploads/2022/11/Las-Condes.png"
    />
    <Inmueble
      titulo="Departamento en Vitacura"
      subtitulo="Proyecto Real Vitacura: 5 dormitorios, y 3 baños."
      imagenInmueble= ""
    />
    <Inmueble
      titulo="Departamento en Las Condes"
      subtitulo="Proyecto Plaza el Golf: 4 dormitorios, y 2 baños."
      imagenInmueble= ""
    />        

    <Casas/>
    <Departamentos/>
    <Edificios/>
    <Townhouse/>
    </>
  );
}

export default App;
